INSERT INTO `projects` VALUES (2,2,'単体タスク','プロジェクトに所属しないタスク',NULL,'2020-05-14 23:23:51','2020-05-14 23:23:51'),(31,2,'タスクマネージャー','・アイテムの種類（タスク、メモ、リスト、日記？）タグは共通、相互に変換可能\n・進捗がみんなに見えるようにする（応援ボタン、成果物ページへのリンク）\n・点数をつける（ランキング）・ランキング作成サービス・相関図作成サービス・情報を開示できる範囲を柔軟に設定できる\n・承認欲求を煽る感じで\n・ログインボーナス（ポイント）\n\n・reminderブランチからSASSでCSS設計を行う','2020-06-30 11:09:00','2020-06-29 13:18:45','2020-06-30 11:09:52'),(41,2,'マトリックスアプリ',NULL,'2020-06-29 13:49:00','2020-06-29 13:47:45','2020-06-29 13:49:29'),(51,2,'メディアデータベース','・ログテーブル\n・関数化\n・sourceテーブル作る\n・公式サイト\n・Wikipediaからスクレイピング（アニメ）\n・（データベース）映画館テーブル作る\n・（データベース）スクリーンテーブル作る（3500スクリーンくらい）\n・（データベース）テレビ局テーブル作る\n・（DB）映倫番号取得スクリプト（file_get_contentsが通らない！）\n・Twitterで作品／人／会社の話題を取得して流す\n・各作品ページでその作品について語れる掲示板・情報交換機能\n\n■なんでもランキング（マトメディア）\n・簡単にランキングを作れる機能（GUI）\n・SNSでリコメンドする機能\n・どの配信サービス／図書館／販売等で入手できるかは欲しい','2020-06-29 16:38:00','2020-06-29 14:02:52','2020-06-29 16:43:00'),(61,2,'ブログの改善',NULL,'2020-12-29 14:05:25','2020-06-29 14:05:28','2020-06-29 14:05:28'),(71,2,'大掃除',NULL,'2021-03-29 14:17:59','2020-06-29 14:18:01','2020-06-29 14:18:01'),(81,2,'ゲーム開発（civ）',NULL,'2021-06-29 16:06:29','2020-06-29 16:06:31','2020-06-29 16:06:31'),(91,2,'クロスワードパズル共有サイト',NULL,'2021-06-29 16:34:36','2020-06-29 16:34:37','2020-06-29 16:34:37');
