CREATE TABLE `tasks` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `project_id` int(10) unsigned NOT NULL,
  `name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `overview` text COLLATE utf8mb4_unicode_ci,
  `priority` tinyint(4) NOT NULL COMMENT '優先度',
  `difficulty` tinyint(4) NOT NULL COMMENT '難易度',
  `start_date` datetime NOT NULL DEFAULT '2020-05-14 23:21:20' COMMENT '開始日時',
  `dead_line` datetime NOT NULL COMMENT '締切',
  `is_template` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'テンプレートファイル',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `tasks_user_id_foreign` (`user_id`),
  KEY `tasks_project_id_foreign` (`project_id`),
  CONSTRAINT `tasks_project_id_foreign` FOREIGN KEY (`project_id`) REFERENCES `projects` (`id`) ON DELETE CASCADE,
  CONSTRAINT `tasks_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4161 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
